INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES 
(1346, 'zhTW', '', '|cFFFFD200|r|n', '', 34963),
(1346, 'zhCN', '', '|cFFFFD200|r|n', '', 34963),
(1346, 'ruRU', ' ', '|cFFFFD200 |r|n', '        ,      .             ,  \"   \". ,     .', 34963),
(1346, 'ptBR', 'Incinerador Corao Demonaco', '|cFFFFD200Loja do jogo|r|n', 'Um gnomo inventor maluco sonhava em montar em um drago, ento criou essa monstruosidade de metal, que energizou com um demnio aprisionado para criar \"uma alma autntica de drago\". O gnomo no sobreviveu  ativao.', 34963),
(1346, 'koKR', ' ', '|cFFFFD200  |r|n', '          .       .  \"  \"               . ', 34963),
(1346, 'itIT', 'Inceneritore Scagliaferrea', '|cFFFFD200Negozio di gioco|r', 'Un folle inventore Gnomo sognava di cavalcare un drago, cos ha creato questa mostruosit di metallo. L''ha alimentata con un demone intrappolato per ricreare \"un''autentica anima di drago\", ma non  sopravvissuto all''attivazione.', 34963),
(1346, 'frFR', 'Incinrateur fumcaille', '|cFFFFD200Boutique en jeu|r|n', 'Un Gnome, inventeur fou, rva un jour quil chevauchait un dragon. Il cra donc ce monstre de mtal. Il emprisonna un dmon pour alimenter sa machine, afin de crer lme authentique dun dragon, mais ne survcut pas  son activation.', 34963),
(1346, 'esMX', 'Incinerador metalescama', '|cFFFFD200Tienda del juego|r|n', 'Un inventor gnomo loco tena el sueo de montar un dragn y construy esta monstruosidad de metal. Para crear \"una autntica alma de dragn\", le dio energa con un demonio atrapado, pero no sobrevivi a la activacin.', 34963),
(1346, 'esES', 'Incinerador escamavapor', '|cFFFFD200Tienda del juego|r|n', 'Un inventor gnomo loco soaba con montar en un dragn, as que cre este monstruo de metal. Us un demonio atrapado para darle energa y poder crear un \"alma de dragn autntica\", pero no sobrevivi a su activacin.', 34963),
(1346, 'deDE', 'Dampfschuppeneinscherer', '|cFFFFD200WoW-Shop|r|n', 'Ein wahnsinniger gnomischer Erfinder hatte den Traum, einen Drachen zu reiten, und erschuf daher kurzerhand diese metallische Monstrositt. Als Antrieb verwendete er einen gefangenen Dmon, um \"eine authentische Drachsenseele\" zu erschaffen, jedoch berlebte er die Inbetriebnahme nicht.', 34963);
