INSERT INTO `mail_template_locale` (`ID`, `locale`, `Body_lang`, `VerifiedBuild`) VALUES 
(550, 'zhTW', '\n\n\n - ', 34963),
(550, 'zhCN', '\n\n', 34963),
(550, 'ruRU', '   ,     ,     . -    ,     ,      ,   .\n     !\n -   WoW', 34963),
(550, 'ptBR', 'Para reativar sua conta com ouro, retiramos dinheiro no coletado do seu correio. Por isso, voc ver menos dinheiro no correio do que esperava. No se espante, nenhum dinheiro se perdeu.\nObrigado, e boas-vindas de volta a Azeroth!\n - A Equipe de Desenvolvimento do WoW', 34963),
(550, 'koKR', '       .       ,  .    .\n.     !\n-     ', 34963),
(550, 'itIT', 'Per riattivare il tuo account usando l''oro di gioco, abbiamo prelevato dell''oro non riscattato nella tua casella di posta. Per questo motivo, potresti notare meno oro del previsto nella posta, ma non preoccuparti: niente  andato perso.\nGrazie e bentornato su Azeroth!\n- Il team di sviluppo di WoW', 34963),
(550, 'frFR', 'Afin de ractiver votre compte avec des pices dor, nous avons retir des fonds que vous naviez pas encore rcuprs dans votre bote aux lettres. En consquence, vous remarquerez peut-tre quelle contient moins dor que vous ne le pensiez. Ne vous en faites pas, vous navez rien perdu!\nMerci! Nous sommes ravis de vous retrouver sur Azeroth!\nLquipe de dveloppement de WoW', 34963),
(550, 'esMX', 'Para reactivar tu cuenta con oro, hemos retirado dinero no recolectado de tu correo. Debido a esto, es posible que veas que hay menos dinero del que esperabas en el correo. No te preocupes, ya que el dinero no se ha perdido.\nGracias, y disfruta de Azeroth!\n- El equipo de desarrollo de WoW', 34963),
(550, 'esES', 'Para reactivar tu cuenta con oro, hemos retirado algo del dinero disponible en tu correo. Debido a esto, es posible que veas que hay menos dinero del que esperabas en el correo. No te preocupes, ya que no se ha perdido.\nGracias, y disfruta de Azeroth!\n- El equipo de desarrollo de WoW', 34963),
(550, 'deDE', 'Um diesen Account mit Gold reaktivieren zu knnen, haben wir eine gewisse Goldmenge aus der ungeffneten Post verwendet. Daher kann der verbleibende Goldbetrag in der Post geringer ausfallen als erwartet. Es besteht aber kein Grund zur Sorge, da kein Gold verloren gegangen ist.\n\nVielen Dank und willkommen zurck in Azeroth!\n - Das Entwicklerteam von WoW', 34963);
